import Profile from "../../components/Profile";
import './Profile.css'

import FooterPage from "../FooterPage/FooterPage";


const ProfilePage = () => {
    
    
    return (
        <div >

            < Profile />
            <div className="container-fluid text-center">
            <button className="sub1" type="submit">ADD Room</button>
            </div>
            
            <FooterPage />

        </div>
    )
}
export default ProfilePage;
